import React from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import Home from "./Components/home/home"; // Import Home
import { SignIn } from "./Auth/SignIn"; // Import SignIn
import TicketManagement from "./Components/TicketManagement";
import HelpIcon from "./Components/HelpIcon";
import ChatIcon from "./Components/ChatIcon";
import "./Styles/App.css";

const App: React.FC = () => {
  return (
    <Router>
      <main>
        <Routes>
          {/* Định tuyến mặc định chuyển đến /home */}
          <Route path="/" element={<Navigate to="/home" />} />
          {/* Định tuyến đến trang Home */}
          <Route path="/home" element={<Home />} />
          {/* Định tuyến đến trang SignIn */}
          <Route path="/signin" element={<SignIn onAuthSuccess={() => console.log("Signed in")} />} />
          {/* Định tuyến đến TicketManagement nếu cần */}
          <Route path="/tickets" element={<TicketManagement />} />
        </Routes>
        <HelpIcon /> {/* Icon trợ giúp */}
        <ChatIcon /> {/* Icon chat */}
      </main>
    </Router>
  );
};

export default App;
